// Register.jsx

import React, { useState } from "react";
import axios from 'axios';
import { useNavigate } from 'react-router-dom'; // Import useHistory from react-router-dom

function Workspace() {
    const [contact, setContact] = useState({
        username: "",
        password: "",
        email: "",
      });
      const [hoverChange, setHovercolor] = useState(false);
      const navigate = useNavigate(); // Initialize useHistory
    
      function handleChange(event) {
        const { value, name } = event.target;
    
        setContact((prevValue) => ({
          ...prevValue,
          [name]: value,
        }));
      }
    
      function Mousehover() {
        setHovercolor(true);
      }
    
      function MouseOut() {
        setHovercolor(false);
      }
    
      function handleRegistration() {
        axios.post('http://localhost:3001/register', contact)
          .then(response => {
            console.log(response.data);
            // Handle success (you may want to redirect or show a success message)
            // Redirect to another page (e.g., App) on successful registration
            navigate('/homepage'); // Replace '/app' with the actual path you want to navigate to
          })
          .catch(error => {
            console.error(error);
            // Handle error (show an error message to the user)
          });
      }
    
      return (
        <div className="container">
          <h1>
            Hello {contact.username} <br />
            <span className="Greeting">Welcome to Feyverly Service </span>
          </h1>
          <p>{contact.email}</p>
          <form>
            <input
              name="username"
              placeholder="username"
              value={contact.username}
            />
            <input
              name="password"
              placeholder="password"
              value={contact.password}
            />
            <input
              type="email"
              onChange={handleChange}
              name="email"
              placeholder="Email"
              value={contact.email}
            />
            <button style={{ backgroundColor: hoverChange ? "black" : "white" }}
              onMouseOver={Mousehover}
              onMouseOut={MouseOut}
              onClick={handleRegistration}>REGISTER</button>
          </form>
        </div>
      );
    }
    

export default Workspace;
